import React from "react";
import SeatItem from "../SeatItem";
import "./ListSeat.scss";
function ListSeatWrapper(props) {
  // console.log(props.listSeat);
  let { listSeat } = props;
  console.log(listSeat);
  let row = listSeat.length / 16;
  function getListSeat() {
    let arrWItem = [];
    for (let i = 1; i <= row; i++) {
      let arrItem = [];
      for (let j = (i - 1) * 16; j < i * 16; j++) {
        if (j === 7 || j === k * 8 - 1) {
          arrItem.push(<SeatItem seatItem={listSeat[j]} key={i + "keyne"} />);
        }
      }
      arrWItem.push(<div className="rowSeat">{arrItem}</div>);
    }
    return arrWItem;
  }
  return (
    <div className="listSeat">
      <div className="autoCenter">
        <div>{getListSeat()}</div>
      </div>
    </div>
  );
}

export default ListSeatWrapper;
